Array.prototype.join2 = function (split, fn) {
    var result = [], len = this.length, ret_value;
    for (var i = 0; i < len; i++) {
        if ((ret_value = fn.call(this, this[i], i)) !== undefined) {
            result.push(ret_value);
        }
    }
    return result.join(split);
};
