function parse_goods(goods_) {
    if (goods_.substr(-6) == '&nbsp;') goods_ = goods_.substr(0, goods_.length - 6)
    var goods = goods_.split('&nbsp;'), result = [];
    for (var i = 0; i < goods.length; i++) {
        result.push(goods[i].split("`"));
    }
    return result;
}
function parse_history(data){
    var html = '<table border="1" bordercolor="#eeeeee" cellpadding="5" class="small center" width="100%"><tr bgcolor="#f6f6f6"><td width="150">商标名称</td><td width="40">大类</td><td>商标产品</td><td width="40">选择</td></tr>', goods;
    for (var i = 0; i < data.length; i++) {
        goods = parse_goods(data[i].goods);
        html += '<tr><td>' + data[i].name + '</td><td>' + goods[0][0] + '</td><td>' + goods.join2(";", function (item) { return item[3]; }) + '</td><td><input type="checkbox" name="tm-history" value="' + data[i].goods.replace(/&nbsp;/g, "&amp;nbsp;") + '" /></td></tr>';
    }
    html += '</table>';
    ShowAskDialog(html, function () {
        $("#class_info").html('');
        update();
        var close = true;
        $("td input[name='tm-history']").each(function () {
            if (this.checked) {
                return close = load_goods(this.value);
            }
        });
        return close;
    }, '使用已选产品继续注册商标', '请选择历史记录，再次注册商标', 800, 600);
}
function load_history(id, callback) {
    if (typeof id == 'function') {
        callback = id;
        id = '';
    }
    if (typeof callback != 'function') callback = parse_history;
    Ajax({
        url: '/user/trademark/LoadHistory?cls=' + (id || ''),
        dataType : "json",
        succeed: function (msg) {
            if (!msg) {
                ShowSimpleDialog("系统异常！");
                return;
            }
            callback(msg.data);
        },
        error: function () {
            ShowSimpleDialog("系统异常！");
        }
    });
}
function load_goods(goods_) {
    if (goods_.substr(-6) == '&nbsp;') goods_ = goods_.substr(0, goods_.length - 6)
    var goods = goods_.split('&nbsp;'), parms = null;
    for (var i = 0; i < goods.length; i++) {
        parms = goods[i].split("`");
        parms.push(null);
        parms.push(true);
        if (parms.length == 6 && !addgoods_1.apply(null, parms)) return false;
    }
    if (parms != null && parms.length == 6) {
        $("#" + parms[0]).parent().removeClass("optional").addClass("selected");
        showsecond(parms[0], $("#" + parms[0]).attr("title"));
        update(parms[0]);
        load_history(parms[0], parse_history2)
    }
    return true;
}
function emptysearch() { $('div.type_list ul li').addClass('optional'); search_result = null; }

function isenabled(src) {
    return $(src).hasClass("optional") || $(src).hasClass("selected");
}
function searchgoods(value) {
    if (!value) { emptysearch(); return; }
    $('div.type_list ul li').removeClass("selected").removeClass("optional");
    var TM = data['00']['item'];
    for (var one in TM) {
        if (!TM.hasOwnProperty(one)) continue;
        var items2 = TM[one]['item'];
        for (var two in items2) {
            if (!items2.hasOwnProperty(two)) continue;
            var items3 = items2[two].item;
            for (var i = 0; i < items3.length; i++) {
                if (items3[i][1].indexOf(value)>=0) {
                    $("#" + one).parent().addClass('optional');
                    if (!search_result) search_result = {keyword : value};
                    if (!search_result[one]) search_result[one] = { name: TM[one].name, item: {} };
                    if (!search_result[one].item[two]) search_result[one].item[two] = { name: items2[two].name, item: {} };
                    search_result[one].item[two].item[Crc32(one + "-" + two + "-" + items3[i][0] + "-" + items3[i][1])] = true;
                }
            }
        }
    }
}
function searchno(value, returnError){
    if (!value || value=='请输入商品编号 例如：030091') {return false; }
    var find = false;
    try{
	    var TM = data['00']['item'];
	    for (var one in TM) {
	        if (!TM.hasOwnProperty(one)) continue;
	        var items2 = TM[one]['item'];
	        for (var two in items2) {
	            if (!items2.hasOwnProperty(two)) continue;
	            var items3 = items2[two].item;
	            for (var i = 0; i < items3.length; i++) {
	                if (items3[i][0]==value.toUpperCase()) {
				        var parms = [one, two, items3[i][0], items3[i][1]];
				        parms.push(null);
				        parms.push(true);
				        addgoods_1.apply(null, parms);
	                    find = true;
	                }
	            }
	            if(find) break;
	        }
	        if(find) break;
	    }
	}catch(ex){}
    if(!find){
        if(returnError!==false) ShowSimpleDialog("未找到相关商品，请确认您的输入是否正确！");
		return false;
    }
    return true;
}
