function DoSubmit(frm, pay) {
    var name = frm.name; //tmfrm
    if (name == 'tmfrm') {
        if (!frm['applyerid'].value) {
            ShowSimpleDialog("请先选择联系人");
            return false;
        }
        //if (!frm['fileWtName'].value) {
        //    ShowSimpleDialog("请上传代理委托书");
        //    return false;
        //}
    } else {
        if (!frm['tmzcr.appCnName'].value) {
            ShowSimpleDialog("请填写联系人名称");
            return false;
        }
        if (!frm['tmzcr.appContactTel'].value) {
            ShowSimpleDialog("请填写联系人电话");
            return false;
        }
    }
    if (!frm['tmzcr.name'].value) {
        ShowSimpleDialog("请填写商标名称");
        return false;
    }
    if(!checkTmDeclare()) {
        ShowSimpleDialog("商标说明不得超过180个字节");
        return false;
    }
    if (!frm['imageShow1'].value) {
        ShowSimpleDialog("请上传黑白图样");
        return false;
    }
    if (getCheckedValue("input[name='iscolored']")=='2') {
        if (!frm['imageShow2'].value) {
            ShowSimpleDialog("请上传着色图样");
            return false;
        }
    }
    var goods = getgoods();
    if (goods.length == 0) {
        ShowSimpleDialog("请选择要注册的商品或服务");
        return false;
    }
    var data = Ajax.Serializ(frm, 'utf-8');
    function SaveOrder(index, message) {
        if (index >= goods.length) {
            if (message.length > 0) {
                var messages = message.join("<br />");
                if (messages.indexOf('保存成功')>=0) {
                    ShowSimpleDialog(messages + '<br />正在跳转到会员中心。。。');
                    window.setTimeout(function () { window.location = "/user/my/" }, 4000);
                } else {
                    ShowSimpleDialog(messages);
                }
            } else {
                ShowSimpleDialog('订单全部提交成功，页面跳转中。。。');
                window.setTimeout(function () { window.location = "/user/my/" }, 2000);
            }
            return;
        }
        var order_goods = goods[index];
        Ajax({
            url: "/reg/",
            method: "POST",
            data: data + "&goodNamearray=" + Ajax.encode.utf8(order_goods.join("&nbsp;")) + "&pay=" + (pay?"yes":"no"),
            dataType: "json",
            succeed: function (msg) {
                if (!msg) ShowSimpleDialog('系统错误');
                else if (msg.error) ShowSimpleDialog(msg.msg);
                else {
                    if (msg.payed === false) {
                        if (msg.producttype == 'zhucebm') {
                            message.push("商标“" + msg.name + "”保存失败，原因：" + msg.msg);
                        } else {
                            message.push("商标“" + msg.name + "”保存成功，但由于“" + msg.msg + "”支付失败，可进入会员中心尝试再次支付订单，付款后将会提交至商标专员进行初审。");
                        }
                    }
                    SaveOrder(index + 1, message);
                }
            },
            error: function () {
                ShowSimpleDialog('系统错误');
            }
        });
    }
    if (pay) {
        //ShowButton();
        //$(".tip-box-button").on('click', function () {
        //    $(".tip-box-button").off('click');
        //    HideButton();
            ShowTipsDialog("正在提交订单。。。");
            SaveOrder(0, []);
        //});
    } else {
        ShowTipsDialog("正在提交订单。。。");
        SaveOrder(0, []);
    }
    return false;
}
function update(id) {
    var fele = document.getElementById('isfapiao');
    var fee = 0,
        orders = 0,
        fapiao = 0,
        isfapiao = (fele ? fele.checked : false),
        frm = document.forms['tmfrm'] || document.forms['tmfrm-gk'],
        jq = null,
        code = frm['cardcode'] ? frm['cardcode'].value : "" ;
    var code_amount = codes[code] || 0;

    if (id) jq = $("#" + id).siblings();
    else jq = $("div.type_list ul li");
    jq.each(function(){
        if (!isenabled(this)) return;
        $(this).removeClass("selected").addClass("optional");
    });
    $("#class_info>li[data-id]").each(function () {
        var count = $(this).find("a[data-content]").length, one = $(this).data("id"), ifee=0;
        if (count == 0) {
            this.parentNode.removeChild(this);
            return;
        }
        $("#" + one).parent().removeClass('optional').addClass('selected')
        orders++;
        ifee = base;
        getid("ab" + one).innerHTML = count;
        if (count >= 10) {
            ifee += (count - 10) * add;
            getid("qiehuan" + one).innerHTML = '10项以上每项加收<em style="color:red;">' + add + '</em>元';
        } else {
            getid("qiehuan" + one).innerHTML = '还可以再选择<em style="color:red;">' + (10 - count) + '</em>项,10项以内<em style="color:red;">' + base + '</em>元';
        }
        fee += ifee;
    });
    if (fee > 0) {
        if (isfapiao && !is_contains_fapiao) fee = fee * 1.06;
        if (code_amount > 0) fee = fee - code_amount;
    }
    $("span.total_span span").html(orders + "个");
    $("span.jiage").html("¥ " + fee.toFixed(2) + " 元");
}
function addgoods_1(one, two, three, desc, src, noupdate) {
    if (order_is_payed && $('li[data-id] div.info_a a[data-content]').length>=max_total_count) {
		ShowTipsAutoClose("当前已支付订单不允许选择超过" + max_total_count + "个产品！", 1500);
        return false;
	}
    if (itemid > 0 && $("#class_info>li[data-id]").length > 0 && $("#class_info>li[data-id='" + one + "']").length==0) {
        ShowTipsAutoClose("修改订单时只允许选择一个分类！<br />把原分类的所有产品删除后，可继续选择其他分类。", 2500);
        return false;
    }
    if(src)$(src).parent().addClass('selected');
    addgoods(one, two, three, desc, noupdate);
    return true
}
function addgoods(one, two, three, desc, noupdate) {
    var html = "";
    if ($("#class_info>li[data-id='" + one + "']").length == 0) {
        html = '<li data-id="' + one + '" >';
        html += '<h3 class="clearfix">';
        html += '<a href="javascript:void(0);" onclick="deletegoods(\'' + one + '\');" class="icon icon_delete"></a>';
        html += '<span class="icon icon_drop"></span><span>第' + one + '类 ' + classes[one] + '</span>';
        html += '<span class="hit">(共<em id="ab' + one + '" style="color:red;"></em>项,<em id="qiehuan' + one + '"></em>)</span>';
        html += '</h3>';
        html += '<div class="info_a"></div></li>';
        $("#class_info").append(html);
    }
    var block = $("#class_info>li[data-id='" + one + "']").get(0).lastChild;
    if (!getid("tm-sub-" + two)) {
        $(block).append('<div id="tm-sub-' + two + '"><span class="newlook">' + two + '</span></div>');
    }
    var items = getid("tm-sub-" + two), tag = Crc32(one + "-" + two + "-" + three + "-" + desc), tag2 = Crc32(three + "-" + desc);
    if (getid("tm-id-" + tag2)) return;

    $(items).append('<a href="javascript:void(0);" onclick="deletegoods(\'' + tag + '\', this)" id="tm-id-' + tag2 + '" data-content="' + one + "`" + two + "`" + three + "`" + desc + '">' + desc + '</a>');
    if (noupdate!==false) update();
};

function deletegoods(tag, src) {
    if (src === undefined) {
        $("#class_info>li[data-id='" + tag + "']").remove();
        $("div.list_main dl[ims='" + tag + "']>dd>ul>li.selected").removeClass('selected');
    } else {
        $("#choose-" + tag).removeClass("selected");
        var p = src.parentNode;
        p.removeChild(src);
        if ($(p).find("a[data-content]").length == 0) p.parentNode.removeChild(p);
    }
    update();
};

